import React from 'react'


class TeasInput extends React.Component{

    render(){
        return(
            <div>
                <form>
                <input name="name" placeholder="Name" onChange={this.handleChange} value={this.state.name}/><br/>
                <input name="brand" placeholder="brand" onChange={this.handleChange} value={this.state.brand}/><br/>
          <input name="description" placeholder="description" onChange={this.handleChange} value={this.state.description}
          /><br/>
          <input
            name="img_url"
            placeholder="img_url"
            onChange={this.handleChange}
            value={this.state.img_url}
          /><br/>
          <input
            name="price"
            placeholder="price"
            onChange={this.handleChange}
            value={this.state.price}
          /><br/>

          <input type="submit" value="Add Tea"/>
                </form>
            </div>
        )
    }
}

export default TeasInput
